import React , { useRef } from 'react'
import { Container, form } from 'react-bootstrap'


export default function Login() {
    const idRef = useRef()
    return (
        <Container>
            <form>
                <Form.Label>Enter Your ID</Form.Label>
                <Form.Control type='text' ref={idRef}></Form.Control>>
            </form>
        </Container>
    )
}
